Page=new Array();Page[0]=new Array("I vinduet Papir/output kan du vælge grundlæggende indstillinger for de fleste opgaver.","Opgavetype","Papir","1- eller 2-sidet","Hvis din printer kan udskrive 2&#8209;sidet, kan du vælge automatisk at udskrive dine opgaver på begge sider af papiret.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Nogle papirtyper, formater og vægte udskrives ikke automatisk på begge sider. Se printerdokumentationen for flere oplysninger.","Sådan udskrives der på to sider:","Klik på piltasterne ud for 2-sidet udskrivning i vinduet Papir/output og vælg en indstilling.","1-sidet udskrivning: Udskriver på den ene side af papiret. Anvend denne indstilling ved udskrivning på transparenter, konvolutter, etiketter eller andet materiale, som ikke kan udskrives på begge sider.","2-sidet udskrivning: Udskriver på begge sider af papiret, så der kan indbindes langs den lange kant.","2-sidet, blokformat: Udskriver på begge sider af papiret, så der kan indbindes langs den korte kant.","Se også: ","Miljøsmart-indstillinger","Udskrivningskvalitet","Anvendes til at styre udskriftens udseende for farve, registrering, tydelighed og hvor meget den ligner originalen.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges en printkvalitet:","Klik på piltasterne ud for Printkvalitet i vinduet Papir/output og vælg en indstilling.","Enhanced: Provides the best overall image quality, 525 x 450 dpi, for CAD applications and fine detail. Lines and edges are enhanced for smoothness. Black and dark colors are enhanced for richness.","Lysægte farve eller Høj hastighed: Den hurtigste farvefunktion og udskriver ved 188 x 400 dpi. Brug denne funktion, hvis du har mange billeder og for at se et eksempel på dit arbejde. Lysægte farve fremstiller hurtigt dokumenter til visning og er idéelt til hasteopgaver. Anvendes til papir med standardformat i magasin 1. Anbefales ikke til dokumenter, som indeholder lille tekst, mange små detaljer eller store, sorte områder.","High Resolution: Halftones and prints at 525 x 400 dpi. It provides the best overall image quality for detailed line drawings such as CAD files. Recommended for printing vibrant, saturated, color prints or photos. The print job can take longer to process when printed using this print-quality mode.","Høj kvalitet: Gengiver tynde streger og detaljer. Anbefales for livlige, mættede farveudskrifter.","Foto gengiver bedst de fleste detaljer i fotos.","Standard: Produces crisp, bright prints at high speed and is ideal for black text. Standard provides the best trade-off between performance and image quality for most jobs. Standard prints halftones at 300 x 450 dpi.","Bemærk: Anvend altid Standard til at udskrive transparenter.","Tonersparer: Reducerer mængden af toner, der anvendes ved udskrivning. Dette er nyttigt for kladdekvalitet. Printkvaliteten er lidt dårligere, end når der er valgt Standard. Tonersparer rastererer og udskriver med en opløsning på 600 x 600 dpi.","Efterbehandling","Udfaldsbakke","Papir/output","paper_output.html");
Page[1]=new Array("Opgavetype bestemmer, hvordan en opgave udskrives. Du kan kræve et kodeord for udskrivning, gemme et dokument på printeren eller vælge et bestemt udskrivningstidspunkt for opgaven. Du kan også sende en fax.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Almindelig udskrivning","Almindelig udskrivning gemmer ikke til printeren til senere udskrivning og behøver ikke et kodeord. Dette er standardopgavetypen. Anvend Almindelig udskrivning til at udskrive en opgave med det samme.","Sådan anvendes Almindelig udskrivning:","Klik på piltasterne og vælg Normal udskrivning ud for Opgavetype i vinduet Papir/output.","Foretag eventuelt yderligere valg for udskrivningsopgaven.","Klik på Udskriv.","Fortrolig udskrivning","Udskudt udskrivning","Prøvesæt","Prøvesæt udskriver et sæt af en opgave, som består af mange kopisæt, før de resterende kopier udskrives. Når du har kontrolleret prøvesættet, kan du enten vælge at udskrive de resterende kopier eller slette dem på printerens betjeningspanel.","Sådan udskrives en prøveudskrivning:","Klik på piltasterne og vælg Prøveudskrivning ud for Opgavetype i vinduet Papir/output.","Klik på Udskriv. Der udskrives en enkelt prøvekopi.","Hvis du er tilfreds med prøvekopien, kan du udskrive resten af ​​kopierne fra printerens betjeningspanel.","Se også: ","Miljøsmart-indstillinger","Gemt fil/Gem fil i mappe","Personlig udskrivning","Vælg Personlig udskrivning ud for Opgavetype i vinduet Papir/output.","Klik på OK.","Klik på Udskriv.","Prøveudskrivning","Udskriv med","Fax","Opgavetype","job_type.html");
Page[2]=new Array("Anvend Fortrolig udskrivning til fortrolige eller personlige oplysninger. Når du har sendt opgaven, tilbageholdes den på printeren, indtil du indtaster kodeordet på printerens betjeningspanel.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan anvendes Fortrolig udskrivning:","Klik på piltasterne og vælg Fortrolig udskrivning ud for Opgavetype i vinduet Papir/output.","Genindtast dernæst et 4-10 cifret kodeord i kodeordsfelterne. Når du sender en fortrolig udskrivningsopgave, tilbageholdes opgaven, indtil du indtaster et kodeord på betjeningspanelet.","I feltet Bekræft kodeord skal du indtaste kodeordet igen.","Klik på OK.","Klik på Udskriv.","Hvis du vil udskrive opgaven, skal du indtaste kodeordet på printerens betjeningspanel.","Indstilling for fortrolig udskrivning","secure_print.html");
Page[3]=new Array("Brug Udskudt udskrivning til at udskrive opgaven på et bestemt tidspunkt. Hvis du f.eks. udskriver en stor opgave, kan du indstille opgaven til at blive udskrevet uden for kontortiden.","Udskudt udskrivning fungerer med en 24-timers periode, der starter, når du sender opgaven til printeren. Hvis du sender udskrivningsopgaven efter det angivne sendetidspunkt, udskrives opgaven, når den angivne tid nås inden for de næste 24 timer. Hvis du f.eks. indstiller udskrivningstidspunktet til 4:30 P.M., men sender opgaven 4:31 P.M., udskrives opgaven 4:30 P.M. den næste dag.","Forsinkelser på netværk eller i printkøer kan få udskrivningsopgaven til at ankomme til printeren efter det angivne tidspunkt. Forsinkelser kan også forekomme, hvis der er en forskel mellem printerens urindstilling og urindstillingen på din computer. Hvis det er tilfældet, udskrives opgaven straks.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan udskrives ved hjælp af Udskudt udskrivning:","Klik på piltasterne og vælg Udskudt udskrivning ud for Opgavetype i vinduet Papir/output.","Hvis du vil indstille klokkeslæt, skal du klikke på piltasterne og derefter vælge timer og minutter.","Klik på OK.","Klik på Udskriv.","Indstilling af Udskudt udskrivning","delay_print.html");
Page[4]=new Array("Gemte opgaver er dokumenter, som er sendt til printeren og gemt der til fremtidig anvendelse.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan udskrives en gemt opgave:","Klik på piltasterne og vælg Gemt opgave eller Gem fil i mappe ud for Opgavetype i vinduet Papir/output.","Gør et af følgende for at vælge et navn for din opgave:","Indtast et navn for opgaven.","Klik på pilen til højre for feltet og vælg et navn i listen.","Klik på pilen til højre for feltet og vælg Anvend dokumentnavn for at anvende dokumentets navn.","Vælg en af følgende muligheder for Mappe:","Indtast destinationsmappens nummer.","Klik på piltasten, og vælg et mappenummer i listen.","Vælg en indstilling. Hvis du vælger Privat, skal du indtaste og derefter genindtaste kodeordet.","Klik på OK.","Gemt fil/Gem fil i mappe","saved_job.html");
Page[5]=new Array("Prøveudskrivning giver dig mulighed for at udskrive en kopi af en flere-kopi-opgave for at se resultatet, før du udskriver de resterende kopier. Når du har kontrolleret prøvekopien, kan du enten vælge at udskrive de resterende kopier eller slette dem på printerens betjeningspanel.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan udskrives med Prøveudskrivning:","Vælg Prøveudskrivning ud for Opgavetype i vinduet Papir/output.","Indtast et opgavenavn for opgaven, eller vælg Anvend dokumentnavn for at bruge navnet på den dokumentfil, der afsendes.","Klik på OK.","Klik på Udskriv. Der udskrives en enkelt prøvekopi.","Hvis du er tilfreds med prøvekopien, kan du udskrive resten af ​​kopierne fra printerens betjeningspanel.","Se også: ","Miljøsmart-indstillinger","Prøveudskrivning","proof_print.html");
Page[6]=new Array("Denne funktion giver dig mulighed for at udskrive gemte private og fælles opgaver med den aktuelle udskrivningsopgave. Du kan f.eks. udskrive et omslag med et sæt gemte dokumenter, såsom brochurer og prislister.","Bemærk:  Denne opgavetype er kun tilgængelig på printere, der er tilsluttet et netværk, og hvorpå tovejskommunikation er aktiveret.","Sådan udskrives der vha. Udskriv med:","Vælg Udskriv med ud for Opgavetype i vinduet Papir/output.","Når du bliver bedt om det, skal du indtaste det kodeord, som du tildelte gemte opgaver på printeren. Klik derefter på OK.","Klik på Annuller, hvis du ikke tildelte et kodeord.","Vælg en indstilling i listen Gemte opgaver.","Personlige og delte, gemte opgaver","Fælles, gemte opgaver","Fælles, gemte opgaver viser delte opgaver, der er gemt på printerens harddisk. Delte opgaver kan anvendes af enhver bruger.","Personlige, gemte opgaver","Personlige, gemte opgaver viser opgaver, der er gemt under dit brugernavn og din nuværende adgangskode, så kun du kan udskrive dem. Klik på Kodeord @ for at indtaste det samme kodeord, som du brugte, da du gemte private, gemte opgaver på printerens harddisk.","Bemærk: Personligt gemte opgaver kræver et kodeord.","Hvis du vælger Personlige og delte, gemte opgaver eller Personlige, gemte opgaver, skal du indtaste kodeordene for opgaverne. Hvis dine opgaver ikke vises, skal du klikke på Kodeord og derefter genindtaste et gyldigt kodeord for opgaverne.","Hvis du vil føje en opgave til den endelige liste, skal du vælge en opgave i listen og derefter klikke på pil-ned.","Vælg en opgave og klik på op- eller ned-piltasterne for at ændre rækkefølgen af de viste opgaver i listen.","Hvis du vil slette en opgave fra listen, skal du vælge den og dernæst klikke på Slet.","Klik på OK.","Klik på Udskriv.","Udskriv med","print_with.html");
Page[7]=new Array("I vinduet Kodeord skal du ud for Brugernavn indtaste det brugernavn, som du brugte for den personlig gemte opgave.","I feltet Kodeord skal du indtaste det kodeord, som du brugte for den personlig gemte opgave.","Klik på OK.","Kodeord","passcode.html");
Page[8]=new Array("Brug faxopgavetypen til at sende en fax og administrere faxtelefonbøger og indstillinger.","Vælg Fax ud for Opgavetype for at få adgang til faxmenuerne.","Vælg Modtagere for at tilføje eller redigere faxmodtagere.","Vælg Forside for at redigere eller tilføje en forside.","Vælg Indstillinger for at vælge faxindstillinger.","Sådan duplikeres en faxmodtager:","Fax","fax.html");
Page[9]=new Array("Når du har oprettet faxmodtagerindgange, kan du tilføje indgangene i din personlige telefonbog.","Sådan tilføjes modtagere:","Klik på piltasterne ud for Opgavetype i vinduet Papir/output og vælg Fax.","Klik på Modtagere.","Klik på knappen Tilføj modtager.","Indtast de nye kontaktoplysninger.","Klik på OK.","Sådan redigeres en faxmodtager uden at redigere telefonbogsindgangen:","Klik på piltasterne ud for Opgavetype i vinduet Papir/output og vælg Fax.","Klik på Modtagere.","Vælg modtageren i tabellen, og klik på Rediger.","Foretag de ønskede ændringer alt efter behov.","Klik på OK.","Tilføjelse eller redigering af en faxmodtager","add_edit_fax_recipient.html");
Page[10]=new Array("Du kan føje en faxmodtager fra telefonbogen til faxen.","Sådan føjes en modtager fra din telefonbog til faxen:","Klik på piltasterne ud for Opgavetype i vinduet Papir/output og vælg Fax.","Klik på Modtagere.","Klik på adressebogsikonet, og gør et af følgende:","Vælg en gruppe og dernæst en modtager.","For at finde en modtager skal du indtaste navnet på modtageren i søgefeltet og derefter klikke på OK.","Klik på OK.","Send en fax til en modtager, der er i telefonbogen","add_fax_recipient_from_addressbook.html");
Page[11]=new Array("Faxfunktionen giver dig mulighed for at oprette flere oplysninger for den samme modtager og det samme faxnummer. Hvis du ønsker at inkludere andre postboksoplysninger, e-mail-adresser eller telefonnumre, kan du tilføje en identisk modtager.","Når du tilføjer en identisk modtager, vises der et bekræftelsesvindue.","Klik på Ja for at tilføje en identisk modtager.","Tryk på Nej for at gå tilbage til det forrige vindue.","Identisk faxmodtager","fax_duplicate.html");
Page[12]=new Array("Sådan inkluderes en faxforside:","Klik på piltasterne ud for Opgavetype i vinduet Papir/output og vælg Fax.","Klik på Forside.","Klik på piltasterne ud for Forside og vælg Udskriv en forside.","Klik på knappen ud for Forsidetekst, hvis du ønsker at tilføje en meddelelse til modtagerne.","Klik på knappen ud for Afsenderoplysninger, hvis du vil tilføje kontaktoplysninger.","Klik på knappen ud for Modtageroplysninger, hvis du vil redigere modtageroplysningerne.","Klik på piltasterne ud for Forsidebillede og vælg en indstilling.","Vælg Ingen for at inaktivere forsidebilleder.","Hvis du vil vælge et forsidebillede, der allerede er gemt på printeren, skal du vælge det i listen.","Hvis du vil redigere et tidligere gemt forsidebillede, skal du vælge det i listen og klikke på Rediger.","Klik på Nyt for at oprette et nyt forsidebillede.","Klik på Papirformat til forside, og vælg en indstilling.","Klik på OK.","Faxforside","fax_cs.html");
Page[13]=new Array("Sådan redigeres eller tilføjes tekst til en forside:","Indtast den ønskede tekst til forsiden i vinduet Forsidetekst.","Klik på OK.","Tilføjelse eller redigering af Forsidetekst","fax_cs_notes.html");
Page[14]=new Array("Sådan tilføjes eller redigeres afsenderoplysninger:","Indtast navnet på den person, der sender faxen, ud for Afsendernavn.","Indtast navn for firma eller organisation under Organisation.","Indtast e-mailadressen under E-mail-adresse.","Indtast modtagerens telefonnummer under Telefonnummer.","Indtast modtagerens faxnummer ud for Faxnummer.","Afsenderoplysninger","fax_cs_sender_info.html");
Page[15]=new Array("Sådan tilføjes eller redigeres modtageroplysninger:","Vælg en indstilling i vinduet Modtageroplysninger.","Vis modtagere: Viser modtagernavnene på faxforsiden. Oplysningerne vises også på den viste eksempelforside.","Vis ikke modtagere: Skjuler modtagernavnene på faxforsiden.","Vis tilpasset tekst: Gør det muligt at indtaste brugerdefineret tekst i tekstfeltet, som udskrives på faxforsiden. ","Modtageroplysninger","fax_cs_recipient_info.html");
Page[16]=new Array("Du kan tilføje tekst eller billeder til dine faxforside eller du kan bruge-tekst eller billeder gemt på printeren.","Vælg Tekst for at redigere eller tilføje tekst på en forside.","Vælg Tekst i vinduet Redigering af forside.","Hvis du vil formatere teksten, skal du klikke på Vis fonte i listen og vælge de ønskede fontindstillinger.","For Vinkel skal du angive tekstens vinkel på siden. Brug piltasterne til at justere værdien. Brug skyderen til at vælge en værdi.","Hvis du vil forskyde placeringen af ​​vandmærket fra midten af siden, skal du vælge måleenhed og derefter indtaste værdien for vandret position og lodret position.","Klik på Centreret for at midterstille billedet.","Klik på OK.","Vælg Billede for at redigere eller tilføje billede på en forside.","Vælg Billede i vinduet Redigering af forside.","Ud for Vælg fil skal du indtaste stien til billedfilen eller klik på Vælg fil for at finde filen.","Bemærk: Der kan vælges .bmp, .jpg og .gif-filer.","Hvis du vil ændre billedets størrelse skal du indtaste eller vælge en procentsats under Skalering eller bruge skyderen til at justere værdien.","Hvis du vil forskyde placeringen af ​​vandmærket fra midten af siden, skal du vælge måleenhed og derefter indtaste værdien for vandret position og lodret position.","Klik på Centreret for at midterstille billedet.","Klik på OK.","Redigering af forside","fax_cs_editor.html");
Page[17]=new Array("Brug denne side til at ændre, hvordan din printer håndterer fax. Du kan f.eks. angive at udskrive et bekræftelsesark eller sende en fax på et bestemt tidspunkt.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan anvendes indstillinger for fax:","I vinduet Indstillinger for fax skal du klikke på piltasterne ud for Bekræftelse og dernæst vælge den ønskede indstilling.","Udskriv ikke et bekræftelsesark: Instruerer printeren om ikke at udskrive et bekræftelsesark.","Udskriv et bekræftelsesark: Lader printeren udskrive et bekræftelsesark.","Send til e-mail: Beder printeren om at sende bekræftelsesarket til e-mail-adressen.","Vælg den ønskede indstilling ud for Afsendelseshastighed.","Afsendelseshastighed vælger den korrekte faxtransmissionshastighed i kilobit pr. sekund (kbps) eller bit pr. sekund (bps). Hvis du bor i et område, hvor telefonlinjer ikke kan bruges til fax/datatransmission med høj hastighed, skal du vælge en lavere overførselshastighed. Et lavere overførselshastighed reducerer risikoen for overførselsfejl.","Vælg en indstilling ud for Faxopløsning.","Faxopløsningen bestemmer, hvor mange detaljer der gengives til faxtransmissionen. Faxtransmissioner med højere opløsning bruger mere hukommelse og tager længere tid at sende.","Bemærk: Hvis enheden, der modtager faxen, ikke understøtter den valgte opløsning, nulstiller enheden, der sender faxen, opløsningen, så den passer til enheden, der modtager faxen.","Standard: Anvendes til maskingenereret&#8209; tekst.","Fin: Bruges til stregtegninger, lille og håndskreven tekst.","Superfin: Bruges til finere tekst, tegninger, og billeder med lavere opløsning.","Ultrafin: Bruges til fotografier og fine stregtegninger.","Vælg Send nu eller Send kl. under Afsendelsestidspunkt.","Vælg det tidspunkt, hvor faxen skal sendes. Du kan udskyde afsendelse af faxen med op til 24 timer.","Send nu sender straks faxen.","Indtast op til fire cifre ud for Opkaldspræfiks.","Indtast op til 16 cifre for Kreditkort.","Bemærk: Kreditkortnummeret ikke vises på bekræftelsesrapporter.","Klik på OK.","Faxfunktioner","fax_options.html");
Page[18]=new Array("I vinduet for faxindstillinger skal du klikke på piltasterne ud for Bekræftelse og dernæst vælge Send til e-mail.","Indtast den e-mail-adresse, hvortil faxbekræftelsen skal sendes ud for E-mail-adresse.","Afsendelse af faxbekræftelse til e-mail","send_to_email.html");
Page[19]=new Array("Valg i menuen Papir afgør, hvilket magasin printeren vælger til opgaven. De valgte indstillinger for den aktuelle opgave vises i Papiroversigt. Papiroversigt vises ud for rullemenuen Papir.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Papirfarve","Papirtype","Anden type giver dig mulighed for at vælge en ønsket papirtype for din opgave.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Hvis der vælges en papirtype, der ikke er lagt i printeren, tilbageholdes opgaven på printeren, indtil det valgte papir er ilagt.","Sådan vælges en papirtype:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Anden type.","Gør et af følgende:","Vælg Printerstandard for at anvende printerens standardpapirtype. ","Vælg en papirtype på listen. Hvis administratoren har defineret brugerdefinerede papirtyper for printeren, vises de i listen.","Vælg Automatisk valg for at vælge et papirmagasin, som indeholder en hvilken som helst papirfarve.","Vælg indstillinger for Faneblade/Faneblade, karton.","Regler for papirkonflikt","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg I tilfælde af papirkonflikt.","Vælg en indstilling.","Bed mig på printeren om at lægge det korrekte papirformat i: Sikrer, at papirformaterne matcher før udskrivning.   ","Automatisk skalering og udskrivning på ilagt papirformat: Afpasser dokumentet til papirformatet i magasinet.","Ingen skalering og udskrivning på ilagt papirformat: Udskriver på papir med forskellige papirformater.","Bed mig på printeren om at lægge den korrekte papirtype i: Sikrer, at papirtyperne er korrekte før udskrivning.","Ignorer konflikt og udskriv på den ilagte papirtype: Udskriver på papir med forskellige papirtyper.","Transparentskilleark","Transparentskilleark anvendes til at indsætte blanke ark mellem hver trykt transparent. Format og retning på skilleark skal være den samme som til transparenterne.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Transparentskilleark kan ikke vælges sammen med visse efterbehandlingsmuligheder, som f.eks. Foldning eller Pjecer.","Sådan udskrives der med transparentskilleark:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Transparentskilleark.","Vælg en indstilling for transparentskilleark.","Nej eller Ingen skilleark: Indsætter ikke skilleark.","Blanke skilleark: Indsætter et blankt ark mellem transparenterne.","Trykte skilleark: Indsætter et trykt ark mellem transparenterne. Det trykte ark indeholder samme billede som transparenten.","Vælg en indstilling for Farve.","Klik på OK.","Skilleark","Faneblade","Valg af Omslag","Papir","paper.html");
Page[20]=new Array("Papirfarve giver dig mulighed for at vælge en ønsket papirfarve for din opgave.","Sådan vælges en papirfarve:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Anden farve.","Gør et af følgende:","Vælg Printerens standardfarve for at anvende papirstandardfarven i printeren.","Select a paper color from the list. Hvis administratoren har defineret brugerdefinerede papirfarver for printeren, vises de i listen.","Klik på Automatisk valg for at lade printeren vælge farven.","Bemærk: Hvis der vælges en papirfarve, der ikke er lagt i printeren, tilbageholdes opgaven på printeren, indtil den valgte papirfarve er ilagt.","Papirfarve","other_color.html");
Page[21]=new Array("Anden type giver dig mulighed for at vælge en ønsket papirtype for din opgave.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Hvis der vælges en papirtype, der ikke er lagt i printeren, tilbageholdes opgaven på printeren, indtil det valgte papir er ilagt.","Sådan vælges en papirtype:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Anden type.","Gør et af følgende:","Vælg Printerstandard for at anvende printerens standardpapirtype. ","Vælg en papirtype på listen. Hvis administratoren har defineret brugerdefinerede papirtyper for printeren, vises de i listen.","Vælg Automatisk valg for at vælge et papirmagasin, som indeholder en hvilken som helst papirfarve.","Vælg indstillinger for Faneblade/Faneblade, karton.","Papirtype","other_type.html");
Page[22]=new Array("Hvis din printer ikke indeholder papirtypen, skal du anvende reglerne for papirkonflikt til at justere billedformatet eller ilægge det korrekte papirformat.","Sådan vælges en indstilling for I tilfælde af papirkonflikt:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg I tilfælde af papirkonflikt.","Vælg en indstilling.","Bed mig på printeren om at lægge det korrekte papirformat i: Sikrer, at papirformaterne matcher før udskrivning.   ","Automatisk skalering og udskrivning på ilagt papirformat: Afpasser dokumentet til papirformatet i magasinet.","Ingen skalering og udskrivning på ilagt papirformat: Udskriver på papir med forskellige papirformater.","Bed mig på printeren om at lægge den korrekte papirtype i: Sikrer, at papirtyperne er korrekte før udskrivning.","Ignorer konflikt og udskriv på den ilagte papirtype: Udskriver på papir med forskellige papirtyper.","Regler for papirkonflikt","paper_mismatch.html");
Page[23]=new Array("Transparentskilleark anvendes til at indsætte blanke ark mellem hver trykt transparent. Format og retning på skilleark skal være den samme som til transparenterne.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Transparentskilleark kan ikke vælges sammen med visse efterbehandlingsmuligheder, som f.eks. Foldning eller Pjecer.","Sådan udskrives der med transparentskilleark:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Transparentskilleark.","Vælg en indstilling for transparentskilleark.","Nej eller Ingen skilleark: Indsætter ikke skilleark.","Blanke skilleark: Indsætter et blankt ark mellem transparenterne.","Trykte skilleark: Indsætter et trykt ark mellem transparenterne. Det trykte ark indeholder samme billede som transparenten.","Vælg en indstilling for Farve.","Klik på OK.","Transparentskilleark","transparency_separators.html");
Page[24]=new Array("Skilleark giver dig mulighed for at tilføje et blankt ark mellem kopier, enkelte sider eller hele opgaven.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan udskrives der med skilleark: ","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Skilleark.","Vælg en indstilling.","Nej eller Ingen skilleark: Indsætter ikke skilleark.","Opgaveafslutning: Indsætter et skilleark sidst i udskrivningsopgaven.","Sætafslutning: Indsætter et skilleark efter hver kopi i udskrivningsopgaven. Denne indstilling kræver, at printeren har en harddisk.","Sideafslutning: Indsætter et skilleark efter hver side i udskrivningsopgaven.","Under Magasin skal du vælge det papirmagasin, der indeholder skilleark. Skillearkene skal bruge et andet papirmagasin end det magasin, der anvendes til opgaven.","Klik på OK.","Skilleark","separators.html");
Page[25]=new Array("Indtast antallet af faner under Nummer i sekvens. Nummer i sekvens definerer antallet af unikke ark i et sorteret sæt, før sættet gentages. Hvis en fanebladsopgave f.eks. indeholder fem faneblade, som skal indsættes forskellige steder i sættet, skal der indtastes 5 i feltet Nummer i sekvens.","Vælg en indstilling under Vælg en fanemargin. Hvis du vælger Brugerdefineret, skal du indtaste forskydningsværdien for fanemargin og vælge en indstilling for måleenhed.","Klik på OK.","Faneblade","pre_cut_tabs.html");
Page[26]=new Array("Du kan føje omslag til hver kopi af opgaven. Tilføj kun en forside eller både en forside og en bagside. Du kan udskrive omslag på en anden papirtype eller -farve end resten af ​​opgaven.","Sådan udskrives der med omslag:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Omslag.","Vælg en indstilling for Omslag.","Ingen omslag annullerer alle tidligere omslagsindstillinger.","Kun forside: Indsætter et omslag før den første side i udskrivningsopgaven.","Kun bagside: Indsætter et omslag efter den sidste side i udskrivningsopgaven.","For- og bagside: Samme fremfører papir for forsiden og for bagsiden fra det samme magasin.","For- og bagside: Forskellig: Fremfører papir for forsiden og for bagsiden fra forskellige magasiner.","Vælg et papirmagasin, som indeholder papir til omslag, under Magasin.","Klik på OK.","Omslag","covers.html");
Page[27]=new Array("Hvis din printer kan udskrive 2&#8209;sidet, kan du vælge automatisk at udskrive dine opgaver på begge sider af papiret.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Nogle papirtyper, formater og vægte udskrives ikke automatisk på begge sider. Se printerdokumentationen for flere oplysninger.","Sådan udskrives der på to sider:","Klik på piltasterne ud for 2-sidet udskrivning i vinduet Papir/output og vælg en indstilling.","1-sidet udskrivning: Udskriver på den ene side af papiret. Anvend denne indstilling ved udskrivning på transparenter, konvolutter, etiketter eller andet materiale, som ikke kan udskrives på begge sider.","2-sidet udskrivning: Udskriver på begge sider af papiret, så der kan indbindes langs den lange kant.","2-sidet, blokformat: Udskriver på begge sider af papiret, så der kan indbindes langs den korte kant.","Se også: ","Miljøsmart-indstillinger","1- eller 2-sidet","2_sided_printing.html");
Page[28]=new Array("Anvendes til at styre udskriftens udseende for farve, registrering, tydelighed og hvor meget den ligner originalen.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges en printkvalitet:","Klik på piltasterne ud for Printkvalitet i vinduet Papir/output og vælg en indstilling.","Enhanced: Provides the best overall image quality, 525 x 450 dpi, for CAD applications and fine detail. Lines and edges are enhanced for smoothness. Black and dark colors are enhanced for richness.","Lysægte farve eller Høj hastighed: Den hurtigste farvefunktion og udskriver ved 188 x 400 dpi. Brug denne funktion, hvis du har mange billeder og for at se et eksempel på dit arbejde. Lysægte farve fremstiller hurtigt dokumenter til visning og er idéelt til hasteopgaver. Anvendes til papir med standardformat i magasin 1. Anbefales ikke til dokumenter, som indeholder lille tekst, mange små detaljer eller store, sorte områder.","High Resolution: Halftones and prints at 525 x 400 dpi. It provides the best overall image quality for detailed line drawings such as CAD files. Recommended for printing vibrant, saturated, color prints or photos. The print job can take longer to process when printed using this print-quality mode.","Høj kvalitet: Gengiver tynde streger og detaljer. Anbefales for livlige, mættede farveudskrifter.","Foto gengiver bedst de fleste detaljer i fotos.","Standard: Produces crisp, bright prints at high speed and is ideal for black text. Standard provides the best trade-off between performance and image quality for most jobs. Standard prints halftones at 300 x 450 dpi.","Bemærk: Anvend altid Standard til at udskrive transparenter.","Tonersparer: Reducerer mængden af toner, der anvendes ved udskrivning. Dette er nyttigt for kladdekvalitet. Printkvaliteten er lidt dårligere, end når der er valgt Standard. Tonersparer rastererer og udskriver med en opløsning på 600 x 600 dpi.","Udskrivningskvalitet","print_quality.html");
Page[29]=new Array("Efterbehandling anvendes til at vælge, hvordan dine udskrevne opgaver leveres. Du kan f.eks. vælge hulning, hæftning, foldning eller pjecer.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Hæftning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Hæftning.","Vælg en indstilling for antallet og placeringen af hæfteklammer.","Hulning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Hulning.","Vælg en indstilling for antallet og placeringen af huller.","Foldning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Foldning.","Vælg en indstilling:","2-foldning, et ark, udskriv indvendig: Udskriver dokumentets første side på indersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, et ark, udskriv på yderside: Udskriver dokumentets første side på ydersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, flere ark (Pjecefoldning): Udskriver de ulige sider på ydersiden, og de ​​lige sider på indersiden af ​​det foldede papir. Ark foldes sammen som en pjece.","C-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","C-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Z-foldning, halvt ark, indbinding til venstre: Folder arket som et Z og indbinder langs venstre kant.","Z-foldning, halvt ark, indbinding til højre: Folder arket som et Z og indbinder langs højre kant.","Z-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","Z-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Hvis du vælger 2-foldning, flere ark (Pjecefoldning), skal du eventuelt vælge yderligere indstillinger.","Firkantet foldning","Beskær den yderste kant","Perfect-indbinding","Forskydning/undersæt","Blokke","Pjecer","Efterbehandling","finishing.html");
Page[30]=new Array("Sådan hæftes en udskrivningsopgave:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Hæftning.","Vælg en indstilling for antallet og placeringen af hæfteklammer.","Hæftning","stapling.html");
Page[31]=new Array("Sådan vælges hulning:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Hulning.","Vælg en indstilling for antallet og placeringen af huller.","Hulning","punching.html");
Page[32]=new Array("Sådan udskrives der med Foldning:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Foldning.","Vælg en indstilling:","2-foldning, et ark, udskriv indvendig: Udskriver dokumentets første side på indersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, et ark, udskriv på yderside: Udskriver dokumentets første side på ydersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, flere ark (Pjecefoldning): Udskriver de ulige sider på ydersiden, og de ​​lige sider på indersiden af ​​det foldede papir. Ark foldes sammen som en pjece.","C-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","C-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Z-foldning, halvt ark, indbinding til venstre: Folder arket som et Z og indbinder langs venstre kant.","Z-foldning, halvt ark, indbinding til højre: Folder arket som et Z og indbinder langs højre kant.","Z-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","Z-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Hvis du vælger 2-foldning, flere ark (Pjecefoldning), skal du eventuelt vælge yderligere indstillinger.","Firkantet foldning","Beskær den yderste kant","Foldning","folding.html");
Page[33]=new Array("Kvadratfoldning angiver, hvor meget ryggen af ​​kvadratfoldede pjecer skal foldes.","Sådan vælges indstillinger for Firkantet foldning:","Vælg en indstilling ud for Firkantet foldning i vinduet Firkantet foldning.","Vælg Normal til +2 for at vælge en mere 'firkantet' foldning.","Vælg Normal til -2 for at vælge en 'rundere' foldning.","Vælg Nej for at inaktivere Firkantet foldning.","Klik på OK.","Firkantet foldning","square_fold.html");
Page[34]=new Array("Funktionen Beskær den yderste kant angiver, hvor meget der skal skæres af den udvendige kant af en pjece.","Sådan beskæres den yderste kant:","Marker afkrydsningsfeltet for at aktivere Beskær den yderste kant.","Indtast en værdi ud for Beskær den yderste kant eller brug piltasterne til at vælge en beskæringsværdi for den yderste kant.","Klik på piltasterne i feltet Måleenheder og vælg tommer eller mm.","Klik på OK.","Beskær den yderste kant","trim_outside_edge.html");
Page[35]=new Array("Forskyd output afgør, hvordan kopier forskydes i opgaver med mange kopier. Når funktionen er aktiveret, forskydes kopierne en smule i forhold til hinanden i udfaldsbakken. Denne funktion er tilgængelig, hvis udfaldsbakken kan forskyde output.","Sådan anvendes Forskydning/undersæt:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Forskydning/undersæt.","Vælg en indstilling.","Ingen inaktiverer forskydning. Du kan stadig vælge undersæt.","Hvert sæt forskyder hvert kopisæt i en opgave bestående af mange kopisæt.","Hvert undersæt forskyder et specifikt antal sider i et enkelt sæt.","Efter hvert sæt og hvert undersæt forskyder et specifikt antal sider i et sæt og forskyder også hvert sæt i en opgave bestående af mange kopisæt.","Vælg Aktiver undersæt for at udskrive undersæt i en opgave.","I Sider pr. undersæt skal du indtaste antallet af sider i hvert undersæt. Hvert undersæt skal indeholde det samme antal sider.","Klik på OK.","Forskydning/undersæt","offset_subset.html");
Page[36]=new Array("Denne funktion gør det muligt at lave blokke af enkeltsidede formularer, så det er let af rive hver formular af blokken efter behov. En blok har som regel en bagside af karton og en indbinding langs den øverste kant.","Sådan udskrives blokke:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Blokke.","Vælg en indstilling ved siden af Blokke:","Inaktiveret: Inaktiverer funktionen.","Aktiveret: Aktiverer blokudskrivning.","Vælg en af følgende muligheder for Antal blokke:","Indtast det antal blokke, der skal udskrives.","Vælg Printerstandard for at anvende printerens standardindstilling.","Vælg en af følgende muligheder for Ark pr. blok:","Indtast antallet af ark i hver blok.","Vælg Printerstandard for at anvende printerens standardindstilling.","Under Bagside skal du vælge den ønskede bagsidetype for blokkene.","Vælg indstillinger for Papir.","Andet format: Gør det muligt at vælge papirformat eller oprette et brugerdefineret format.","Anden farve: Gør det muligt at vælge fra en liste over tilgængelige farver eller brugerdefinerede farver, som administratoren definerer.","Anden type: Gør det muligt at vælge papirtypen eller vælge en brugerdefineret type, som administratoren definerer.","Klik på OK.","Oprettelse af blok","pads.html");
Page[37]=new Array("Anvend Perfect Binder til at udskrive og indbinde bøger. Den folder og limer et omslag rundt om bogen. Du kan også beskære bogen til det ønskede format.","Bemærk: ","Denne indstilling vises kun, hvis den relevante efterbehandler er installeret på din printer. Den vises ikke, hvis der er valgt omslag, hæftning, hulning, indbinding, foldning eller pjecelayout.","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan anvendes Perfect Binder:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Perfect-indbinding.","Vælg en indstilling på listen Perfect-indbinding:","Stående - Venstre: Indstiller retningen til stående og indbinder langs den venstre kant.","Stående - Højre: Indstiller retningen til stående og indbinder langs den højre kant.","Liggende - Øverst: Indstiller retningen til liggende og indbinder langs den øverste kant.","Vælg følgende indstillinger for at vælge papir for omslaget fra listen Omslag.","Andet format: Gør det muligt at vælge papirformat eller oprette et brugerdefineret format.","Anden farve: Gør det muligt at vælge fra en liste over tilgængelige farver eller brugerdefinerede farver, som administratoren definerer.","Anden type: Gør det muligt at vælge papirtypen eller vælge en brugerdefineret type, som administratoren definerer.","Vælg efter magasin: Lader dig vælge et papirmagasin til udskrivning.","Vælg en Omslagsplacering.","Hvis du vil vælge, hvordan et omslag udskrives, skal du klikke på menuen og vælge en mulighed.","Blanke eller trykte: Anvender blankt eller fortrykt papir for omslaget.","Udskrevet: Udskriver omslaget på det valgte papir.","Klik på Beskæring, og vælg en indstilling.","Ingen beskæring: Beskærer ikke siderne.","Forkant: Beskærer den kant, som er modsat indbindingskanten.","Tryk ud over renskåret kant: Aktiverer Beskæringsformat, så du kan vælge et beskæringsformat. Tryk ud over renskåret kant tillader, at billedet udvides til kanten af papiret.","Hvis du ønsker at vælge et beskæringsformat, skal du klikke på Beskæringsformat og vælge fra en liste over formater eller vælge Brugerdefineret for at vælge et brugerdefineret format.","Hvis du vil justere beskæringen af en kant, skal du klikke på Beskæringsjusteringer.","Klik på OK.","Perfect Binder","perfect_binder.html");
Page[38]=new Array("Indtast en værdi for den brugerdefinerede bredde ud for Bredde i vinduet Brugerdefineret format eller brug piltasterne til at vælge en værdi.","Indtast en værdi for den brugerdefinerede højde ud for Højde eller brug piltasterne til at vælge en værdi.","Klik på piltasterne i feltet Måleenheder og vælg tommer eller mm.","Klik på OK.","Oprettelse af brugerdefineret papirformat","custom_size.html");
Page[39]=new Array("Sådan justeres omslagsplaceringen:","Foretag de ønskede justeringer for bogblok i vinduet Omslagsplacering.","Centreret: Justerer bogblokken til venstre eller højre på indersiden af omslaget.","Side: Justerer bogblokken op eller ned på indersiden af omslaget.","Klik på OK.","Omslagsplacering","cover_position.html");
Page[40]=new Array("Sådan justeres beskæringen:","Foretag de ønskede justeringer i vinduet Beskæringsjusteringer.","Lodret position: Beskærer bogblokken lodret.","Rotation, øverst: Giver mulighed for finjustering af det øverste skærehoved.","Rotation, forrest: Giver mulighed for finjustering af det forreste skærehoved. Denne justering sikrer, at forkanten af ​​bogen er parallel med indbindingskanten.","Rotation, nederst: Giver mulighed for finjustering af det nederste skærehoved.","Klik på OK.","Beskæringsjusteringer","trimming_adjustments.html");
Page[41]=new Array("Pjecefunktionen udskriver to sider på hver side af papiret. Printerdriveren omsorterer siderne og placererer dem med korrekt retning og sidetal, når de foldes. Siderne kan derefter hæftes for at oprette en pjece. Husk, at en pjeces layout er anderledes end et dokuments layout med et billede på hver side af papiret. Linje- og sideombrydning varierer på samme måde.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Pjecer kan anvendes til at reducere det overordnede sidebillede, så det afpasses efter det valgte papirformat.","Sådan oprettes en pjece:","Klik på piltasterne i panelet Pjecer ud for Efterbehandling af pjecer og vælg en indstilling.","Ingen efterbehandling eller Foldning: Denne funktion hæfter eller folder ikke udskrivningsopgaven.","Pjecefalsning eller Foldning: Falser eller folder opgaven på midten.","Pjece/falsning eller Foldning og hæftning: Denne funktion falser eller folder udskrivningsopgaven på midten og hæfter to gange langs foldningen for at holde siderne på plads.","Slå pjecelayout fra: Anvender ikke indstillinger for pjeceformat i udskrivningsopgaven. Anvend denne indstilling, hvis din opgave allerede er formatteret som en pjece.","Klik på piltasterne ud for Afpas efter nyt papirformat for at lade printeren afpasse et billede efter et nyt papirformat. Vælg det ønskede papirformat. Klik på Brugerdefineret for at angive et brugerdefineret format.","Klik på piltasterne ud for Pjecemargen for at angive margenværdi og vælg en indstilling.","Standard reducerer sidebilledformatet, så dokumentet kan udskrives på et standardpapirformat uden tab af billede. Hvis din printer ikke kan udskrive til kanten af papiret, skal du vælge Standard.","Ingen udskriver dokumentet som en pjece uden af reducere formatet af sidebillederne. Denne indstilling kan beskære billedet, hvis printeren ikke kan udskrive til kanten af papiret.","Bemærk: Eksemplet viser 2 sider med A4-format på et ark med tabloid-format. Billedet til venstre anvender standardmargener. Der er valgt Ingen for billedet til højre. ","Angiv midtersletning og krympning, hvis det er nødvendigt.","Midtersletning: Angiver midtersletningens bredde i punkter mellem siderne. Indtast en værdi eller anvend piltasterne til at vælge antallet af punkter. Et punkt er lig med 0,35 mm.","Krympning: Angiver, hvor meget siden skal forskydes udad (i tiendedele af et punkt). Indtast en værdi eller anvend piltasterne til at vælge, hvor meget billederne på siden skal forskydes.","Klik på OK.","Pjecer","booklet_creation.html");
Page[42]=new Array("Sådan vælges en udfaldsbakke:","Klik på piltasterne ud for Udfaldsbakke i vinduet Papir/output og vælg en indstilling.","Vælg Auto eller Automatisk valg for at sende opgaven til en destination baseret på valgt papirformat og efterbehandling.","Bemærk: ","Visse papirmagasiner kan være utilgængelige afhængig af andre indstillinger.","Hvis din printer kun har en udfaldsbakke, vises denne liste ikke.","Udfaldsbakke","output_destination.html");
Page[43]=new Array("Specialsider er omslag, indsæt og undtagelsessider, som føjes til en udskrivningsopgave. Undtagelsessider har andre indstillinger end resten af siderne i opgaven.","Tilføjelse af omslag","Tilføjelse af indsæt","Tilføjelse af undtagelser","Administration af specialsider","Specialsider, som allerede er indstillet for dine udskrivningsopgaver, vises i oversigtstabellen Specialsider. I tabellen kan du vælge en side, der skal redigeres eller slettes. Du kan også ændre indsættenes rækkefølge i en gruppe af indsæt.","Sådan redigeres, slettes eller flyttes indstillinger:","Vælg en indstilling i listen over gemte sider. Knapperne er aktive.","Klik på knapperne for at vælge den ønskede handling.","Specialsider","special_pages.html");
Page[44]=new Array("Anvend vinduet Tilføj omslag til at føje omslag til hver kopi af et dokument og angive omslagsegenskaber. Feltet Opgaveindstilling viser papirindstillingerne for selve opgaven. Vælg Anvend opgaveindstilling for at anvende opgaveindstillingen for en omslagsegenskab.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan tilføjes omslag:","Klik på knappen Tilføj omslag i vinduet Specialsider.","Klik på OK for at acceptere opgavestandardindstillingerne for alle indstillinger.","Vælg en omslagsindstilling i listen Omslagsindstillinger for at foretage valg.","Ingen omslag annullerer alle tidligere omslagsindstillinger.","Kun forside udskriver første side i opgaven på papir fra det valgte magasin. Ved automatisk 2-sidet udskrivning udskrives de første to sider på forsiden.","Kun bagside udskriver sidste side i opgaven på papir fra det valgte magasin. Ved automatisk 2-sidet udskrivning udskrives de sidste to sider på bagsiden, hvis sættet indeholder et lige antal sider.","For- og bagside: Samme fremfører papir for forsiden og for bagsiden fra det samme magasin.","For- og bagside: Forskellig: Fremfører papir for forsiden og for bagsiden fra forskellige magasiner.","Hvis du vil vælge papirets format, farve eller type, skal du klikke på piltasterne ud for Papir til for- eller bagside og vælge indstillinger. ","Vælg udskrivningsindstillinger for omslag.","Blanke eller trykte: Anvender blankt eller fortrykt papir for omslaget.","Udskriv på side 1 udskriver på forsiden af omslaget.","Udskriv på side 2: Udskriver kun på side 2 af omslaget.","Udskriv på begge sider: Udskriver på begge sider af omslaget.","Klik på OK.","Tilføj omslag","add_covers.html");
Page[45]=new Array("Du kan tilføje blanke eller fortrykte indsæt før side 1 i et dokument eller efter bestemte sider i dokumentet. Du kan f.eks. indsætte et blankt farvet ark papir efter hvert afsnit i et dokument. Noter sidetallene, hvor hvert afsnit slutter. Anvend disse sidetal til at indsætte et ark efter hver angivet side.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan tilføjes et indsæt:","Klik på knappen Tilføj indsæt i vinduet Specialsider.","Vælg indsættypen:","Før side 1 placerer et indsæt før side 1.","Efter side(r): Placerer et indsæt efter de(n) sider, du angiver.","Indtast sidetallet for de(n) sider, som kommer før hvert indsæt i feltet Side(r).","Under Antal skal du vælge angive det ønskede antal indsæt.","Klik på OK for at acceptere opgavestandardindstillingerne for alle indstillinger.","Hvis du vil vælge format, farve eller type, skal du klikke på piltasterne ud for Papir og vælge indstillinger.","Klik på OK.","Tilføj indsæt","add_inserts.html");
Page[46]=new Array("Anvend Tilføj undtagelser til at angive undtagelsessider i din udskrivningsopgave. Undtagelsessider har andre indstillinger end resten af siderne i opgaven. Du kan specificere forskelle, f.eks. sideformat, type og farve. Du kan også ændre den side af papiret, hvorpå der skal udskrives alt efter behov. En opgave kan indeholde mange undtagelser.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan tilføjes en undtagelsesside:","Klik på knappen Tilføj undtagelser i vinduet Specialsider.","For Side(r) skal du angive den side eller sider, hvortil undtagelsen skal tilføjes. Individuelle sider eller sideintervaller skal adskilles med kommaer. Specificerer en række på hinanden følgende sider vha. en bindestreg. Hvis der f.eks. skal vælges siderne 1, 6, 9, 10 og 11, skal du skrive 1, 6, 9-11.","Hvis du vil vælge format, farve eller type, skal du klikke på piltasterne ud for Papir og vælge indstillinger.","Hvis du valgte Faneblade for Papirtype, skal du indtaste antallet af faneblade under Nummer i sekvens.","Hvis du vælger Forsorteret papir under Papirtype, skal du angive papirtypenavnet og nummeret i sekvensen.","Hvis du vil ændre den side, der skal udskrives på ved 2-sidet udskrivning, skal du vælge en indstilling:","1-sidet udskrivning udskriver kun undtagelsessiderne på den ene side.","2-sidet, bogformat udskriver undtagelsessiderne på begge sider af papiret og vender siderne langs den lange kant. Opgaven kan derefter indbindes langs den lange kant af papiret.","2-sidet, blokformat udskriver undtagelsessiderne på begge sider af papiret og vender siderne langs den korte kant. Opgaven kan derefter indbindes langs den korte kant af papiret.","Vælg Billedforskydning for at forskyde billedet på papiret.","Klik på OK.","Tilføj undtagelser","add_exceptions.html");
Page[47]=new Array("Farveindstillingerne afgør den måde, som printerens anvender farve til at fremstille dit dokument.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges indstillinger for farvekorrektion:","Vælg en indstilling under Farvekorrektion i vinduet Farvemuligheder.","Bemærk: Hvis du vil ændre eksempelbilledet, skal du bruge piltasterne under det aktuelle billede og vælge en mulighed.","Automatisk farve anvender den bedste farvekorrektion for tekst, grafik og billeder. Xerox anbefaler denne indstilling.","Livlige farver giver stærkere og mere mættede farver.","Sort/hvid konverterer farver til grånuancer, så der fremstilles en sort/hvid-udskrivningsopgave.","Brugerdefinerede farvemuligheder giver flere indstillinger til tilpasning af farver i udskrivningsopgaven.","Udskriv indstillinger på side udskriver filnavn, valg af udskriftskvalitet og farveindstillinger til udskrivningsopgaven på kanten af siden. Dette er nyttigt, når du eksperimenterer med farveændringer.","Udskrivningsindstilling på side anvender de valgte farveindstillinger i eksempelbilledet.","Farveindstillinger","color_options.html");
Page[48]=new Array("Brugerdefinerede farvemuligheder indeholder flere indstillinger til tilpasning af farver i udskrivningsopgaven.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Farve i Words","Farve i Words justerer farver gennem almindelige sætninger, der beskriver, hvordan farverne skal ændres.","Bemærk: Farvejusteringsfunktionen indeholder traditionelle justeringsskydere til at ændre farver.","Sådan bruger du Farve i Words:","Klik på Farvelæg med ord i vinduet Brugerdefinerede farvemuligheder.","For at vælge den farve, der skal ændres, skal du klikke på piltasterne ud for Hvilken farve skal ændres? og vælge en farve.","Hvis du vil vælge, hvor meget farven skal ændres, skal du klikke på piltasterne ud for Hvor stor ændring? og vælge en indstilling.","Hvis du vil vælge, hvordan farven skal ændres, skal du klikke på piltasterne ud for Hvilken type ændring? og vælge en indstilling. ","Skift en sætning med farvejustering ved at vælge den og derefter vælge nye sætninger fra menuerne.","Klik på Byg ny sætning for at oprette en anden sætning til farvejustering.","Hvis du vil ændre rækkefølgen af sætninger til farvejustering, skal du klikke på dem og derefter bruge piltasterne.","Hvis du vil slette en sætning til farvejustering, skal du vælge sætningen og klikke på X.","Bemærk: Sætningsrækkefølgen afgør udførelsen af hver farveændring.","To view a sample image with the current color changes, select Preview. Fjern markeringen i afkrydsningsfeltet Vis for at se det oprindelige billede. Hvis du vil ændre eksempelbilledet, skal du bruge piltasterne under det aktuelle billede og vælge en mulighed.","Et billedeksempel viser forskellige farveskemaer, så du kan se, hvordan hver farveindstilling påvirker billedet.","Farvejustering","Farvejustering giver faste farvejusteringsindstillinger, som du kan anvende i dine opgaver. Farvejustering gengiver printerens farver, der svarer så meget som muligt til farverne på andre enheder, f.eks. din computerskærm eller et udklip fra en avis. ","Sådan bruges Farvekorrektion:","I vinduet Farvekorrektion skal du klikke på piltasterne og dernæst vælge den ønskede indstilling for farvejustering.","Vælg Brugerdefineret automatisk farve for at oprette en brugerdefineret farvekorrektion.","Klik på OK.","Farvejustering","Anvend Farvejusteringer til at justere specifikke egenskaber af den udskrevne farve. Egenskaber omfatter lysstyrke, kontrast, mætning og farvenuance.","Sådan foretages farvejusteringer:","Vælg skyderne til at vælge indstilling for Lysstyrke, Kontrast, Mætning og Farvenuancer.","To view a sample image with the current color changes, select Preview.","Et billedeksempel viser forskellige farveskemaer, så du kan se, hvordan hver farveindstilling påvirker billedet.","Hvis du vil ændre eksempelbilledet, skal du klikke på pil-op eller pil-ned.","Klik på OK.","Brugerdefinerede farvemuligheder","custom_color_options.html");
Page[49]=new Array("Brugerdefineret automatisk farve åbner vinduet for brugerdefineret farvejustering, som giver avancerede brugere flere farvejusteringsmuligheder.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan foretages farvejusteringer:","Gør et af følgende:","Gør et af følgende for Office Color, Press Match og Spot Color:","Vælg de ønskede indstillinger i menuerne Billedprofil og Tekst- og grafikprofil.","Justér lysstyrke, kontrast, mætning og farvenuancer og klik på Yderligere justering.","Vælg en af følgende muligheder for CIE-farve:","Vælg Anvend altid indbyggede profiler.","Anvend altid indbyggede profiler betyder, at printeren anvender dokumentets indbyggede profiler med den risiko, at der anvendes ikke-standard farveskemaer. Anvendelse af indbyggede profiler kan forringe udskrivningskvaliteten. I tilfælde hvor data er usædvanlig, f.eks. laboratoriedata, er det bedst af anvende farveskemaet i den indbyggede profil den bedste udskrift.","En indbygget profil er en CRD (Color Rendering Dictionary), som er inkluderet sammen med dataen, der sendes fra applikationen, som beskriver farvedataenes egenskaber.","Vælg Anvend aldrig indbyggede profiler.","Anvend aldrig indbyggede profiler anvender aldrig dokumentets indbyggede profiler og reducerer derfor risikoen for, at der anvendes ikke-standard farveskemaer.","Vælg Anvend automatisk indbyggede profiler, hvor det er relevant for at identificere og anvende kendte farveprofiler i dokumentet. Denne mulighed aktiverer Billed- og Tekst- og grafikmenuerne. Vælg de angivne indstillinger. Klik på Yderligere justering for at foretage flere justeringer.","Vælg en indstilling for Tekst og Grafik:","Automatisk farve anvender den bedste farvekorrektion for tekst, grafik og billeder. Xerox anbefaler denne indstilling.","Livlige farver giver stærkere og mere mættede farver.","Sort/hvid kopierer kun i sort og hvid. Alle originalens farver konverteres til grånuancer.","Kolorimetrisk forsøger en nøjagtig farvegengivelse. Denne indstilling gengiver kontrollerede lysforhold.","Som det opfattes giver bedste gengivelse af fotos. Dette inkluderer mapning, som inkluderer subjektive justeringer for hukommelsesfarver.","Mætning giver bedste gengivelse af grafik. Farver er klarere og tydeligere, gengives ikke så nøjagtigt som ved Som det opfattes.","Vælg en af følgende muligheder for Billede: Se forrige trin for en liste over muligheder.","Klik på Yderligere justering for at foretage flere justeringer for Billede.","Vælg de ønskede indstillinger i menuerne Billedprofil og Tekst- og grafikprofil.","Justér lysstyrke, kontrast, mætning og farvenuancer og klik på Yderligere justering.","Vælg en af følgende muligheder for Gråt farverum:","Vælg Anvend RGB-farveindstillinger for Sort.","Anvend RGB-farveindstillinger for Sort anvender grå streger til at tilpasse til indstillinger for RGB-sort. Hvis du vælger denne indstilling, indstilles felterne Tekst og Grafik og Billede til de aktuelle valg på fanen Office Color.","Vælg Anvend CMYK-farveindstillinger for Sort.","Anvend CMYK-farveindstillinger for Sort anvender grå kanaler til at tilpasse til indstillinger for CMYK. Denne indstilling er tættest på monokrom. Hvis du vælger denne indstilling, indstilles felterne Tekst og Grafik og Billede til de aktuelle valg på fanen Press Match.","Vælg Manuel konfiguration af Sort for at manipulere sorte farveindstillinger. Denne mulighed aktiverer Billed- og Tekst- og grafikmenuerne. Vælg de angivne indstillinger. Klik på Yderligere justering for at foretage flere justeringer.","Klik på Yderligere justering for at foretage flere justeringer for Tekst og Grafik. Vælg en indstilling for Tekst og Grafik:","Monokrom grafik er optimeret for at give en mere glidende overgang fra hvid til sort.","Monokrome billeder har en gamma kurve, som er optimeret til at give en skarpere gengivelse i billeder, f.eks. en bedre kontrast.","Kommerciel anvender farver til udskrivning på en almindelig trykenhed.","SWOP Press (Specifications for Web Offset Printing Press) er en professionel CMYK-baseret printstandard, der især anvendes i USA.","Cyan, magenta, gul og sort, som printeren anvender til at danne alle farver.","Euroscale Press overholder papirspecifikationerne for European FOGRA glossy.","FOGRA er en farvestandard, designet til at hjælpe med at udskrive farver i offset og almindelig digital printteknologi.","Japan Color er farvejusteringsindstillingen for Japan. Indstillingen svarer til Japan Color 2001 specifikationerne.","ISO Coated er en emulering af FOGRA 27 standard til udskrivning på coated papir. Udskrivning på coated papir er ikke nødvendig ved anvendelse af denne indstilling.","FOGRA er en farvestandard, designet til at hjælpe med at udskrive farver i offset og almindelig digital printteknologi.","ISO Uncoated er en emulering af FOGRA 29 standard til udskrivning på uncoated papir.","FOGRA er en farvestandard, designet til at hjælpe med at udskrive farver i offset og almindelig digital printteknologi.","SNAP Press (Specifications for Non-Heatset Advertising Printing Press) er en printstandard indenfor grafisk design.","sRGB-display får printeren til at emulere farverne på en kalibreret RGB-display, f.eks. et CRT-display.","Rød, grøn og blå farveindstillinger.","LCD-skærm tilnærmer opgavens farver til farverne på computerskærmen.","Livlig sRGB giver tydeligere og mere mættede farver ved at anvende standard røde, grønne og blå farverum.","Spot Color blander cyan, magenta, gul og sort for at gengive Spot Colors fra en avis eller ugeblad. Vælg Spot Color for at få den bedste Pantone-farvegengivelse.","Ingen fjerner alle farvejusteringer.","Vælg en af følgende muligheder for Billede: Se forrige trin for en liste over muligheder. Klik på Yderligere justering for at foretage flere justeringer for Billede.","Vælg de ønskede indstillinger i menuerne Billedprofil og Tekst- og grafikprofil.","Justér lysstyrke, kontrast, mætning og farvenuancer og klik på Yderligere justering.","Klik på Standardindstillinger for at gå tilbage til de oprindelige systemindstillinger.","Klik på OK.","Brugerdefineret farvejustering","color_correction.html");
Page[50]=new Array("Sådan foretages yderligere justeringer:","Klik på Yderligere justering i vinduet Brugerdefineret farvejustering for et valg.","Vælg Anvend global justering for at anvende farvejusteringerne for det forrige vindue.","Vælg skyderne til at vælge indstilling for Lysstyrke, Kontrast, Mætning og Farvenuancer.","Klik på Standardindstillinger for at gå tilbage til de oprindelige systemindstillinger.","Klik på OK.","Yderligere justeringer","more_adjustments.html");
Page[51]=new Array("Printkvalitet gør det muligt at justere, hvor lys eller mørk tekst og billeder skal være i den udskrevne opgave.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges Printkvalitet for din udskrivningsopgave:","Hvis du vil justere lysstyrken, skal du flytte skyderen til højre for at gøre farverne lysere eller til venstre for at gøre dem mørkere.","Flyt skyderen til højre for at reducere kontrast eller til venstre for at øge kontrast.","Klik på Billedforskydning for at vælge indstillinger for billedforskydning.","Klik på Udskriv.","Billedkvalitet","image_options.html");
Page[52]=new Array("Billedforskydning gør det muligt at ændre billedets placering på siden. Du kan forskyde det udskrevne billede langs X- og Y-aksen på hvert ark.","Sådan vælges indstillinger for Billedforskydning:","Klik på piltasterne og vælge den ønskede indstilling ud for Billedforskydning.","Hvis du vælger 1-sidet udskrivning i vinduet Papir/output, skal du vælge en indstilling for Billedforskydning.","Printerstandard: Anvender standardprinterindstillinger.","Individuel: Giver dig mulighed for at justere indstillingerne manuelt.","Hvis du vælger 2-sidet udskrivning i vinduet Papir/output, skal du vælge en indstilling for Billedforskydning.","Printerstandard: Anvender standardprinterindstillinger.","Individuel: Giver dig mulighed for at justere indstillingerne manuelt.","Spejlvend X: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs X-aksen samtidigt.","Spejlvend Y: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs Y-aksen samtidigt.","Spejlvend begge: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs X- og Y-aksen samtidigt.","Spejlvend X, og så Y: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs X-aksen og i samme retning langs Y-aksen samtidigt.","Spejlvend Y, og så X: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs Y-aksen og i samme retning langs X-aksen samtidigt.","Tandem X: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i samme retning langs X-aksen samtidigt.","Tandem Y: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i samme retning langs Y-aksen samtidigt.","Tandem begge: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i samme retning langs X og Y-aksen samtidigt.","Gør et af følgende for Individuelt:","Indtast den ønskede mængde forskydning for side 1 for at flytte sidens billede langs X-aksen og Y-aksen.","Hvis side 2 er tilgængelig, skal du indtaste den ønskede forskydning af billedet langs X-aksen og Y-aksen.","Bemærk: Side 2-indstillingen er kun tilgængelig, hvis der er valgt 2-sidet udskrivning.","Hvis din printer kan udskrive 2&#8209;sidet, kan du vælge automatisk at udskrive dine opgaver på begge sider af papiret.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Nogle papirtyper, formater og vægte udskrives ikke automatisk på begge sider. Se printerdokumentationen for flere oplysninger.","Sådan udskrives der på to sider:","Klik på piltasterne ud for 2-sidet udskrivning i vinduet Papir/output og vælg en indstilling.","1-sidet udskrivning: Udskriver på den ene side af papiret. Anvend denne indstilling ved udskrivning på transparenter, konvolutter, etiketter eller andet materiale, som ikke kan udskrives på begge sider.","2-sidet udskrivning: Udskriver på begge sider af papiret, så der kan indbindes langs den lange kant.","2-sidet, blokformat: Udskriver på begge sider af papiret, så der kan indbindes langs den korte kant.","Se også: ","Miljøsmart-indstillinger","Klik på OK.","Billedforskydning","image_shift.html");
Page[53]=new Array("Anvend vinduet Pjece/vandmærke til at vælge pjecelayout og vandmærkeindstillinger.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan udskrives med Pjece/vandmærke:","Klik på piltasterne under Pjecelayout i vinduet Pjece/vandmærke og vælg en indstilling.","Aktiveret: Denne indstilling udskriver dokumentet som en pjece. Du kan bruge denne indstilling til et dokument, der ikke er formateret som en pjece.","Inaktiveret: Denne indstilling inaktiverer Pjecelayout. Du kan bruge denne indstilling til et dokument, der er formateret som en pjece.","Aktivér Pjecelayout og klik på Indstillinger for pjecer for at angive andre pjeceindstillinger.","Vælg Udskriv sidekanter for at udskrive en kant rundt om hver side.","Vælg indstillinger for Vandmærke.","Klik på Udskriv.","Pjece/vandmærke","booklet_watermark.html");
Page[54]=new Array("Vælg en indstilling for pjeceefterbehandling.","Klik på piltasterne ud for Afpas efter nyt papirformat og vælg det ønskede format for at lade printeren afpasse pjecen efter et nyt format. Vælg Brugerdefineret for at oprette et brugerdefineret format.","Klik på piltasterne ud for Pjecemargen for at angive margenværdi og vælg en indstilling.","Standard reducerer sidebilledformatet, så dokumentet kan udskrives på et standardpapirformat uden tab af billede.","Ingen udskriver dokumentet som en pjece uden af reducere formatet af sidebillederne. Denne indstilling kan beskære billedet, hvis printeren ikke kan udskrive til kanten af papiret.","Angiv midtersletning og krympning, hvis det er nødvendigt.","Midtersletning: Angiver midtersletningens bredde i punkter mellem siderne. Indtast en værdi eller anvend piltasterne til at vælge antallet af punkter. Et punkt er lig med 0,35 mm.","Krympning: Angiver, hvor meget siden skal forskydes udad (i tiendedele af et punkt). Indtast en værdi eller anvend piltasterne til at vælge, hvor meget billederne på siden skal forskydes.","Klik på OK.","Pjeceindstillinger","booklet_options.html");
Page[55]=new Array("Et vandmærke er et billede eller en tekst, som udskrives nedenunder eller oven på tekst og billeder i opgaven.","Bemærk: Ikke alle operativsystemer understøtter udskrivning af vandmærker.","Oprettelse af et tekstvandmærke","Et tekstvandmærke anvender de tegn, der er indtastet i feltet Tekst som vandmærket. Du kan oprette et tekstvandmærke, der skal udskrives på et dokument. Vælg indstillinger, som f.eks. fontstørrelse, fonttype, fontfarve og vinkel.","Sådan oprettes et tekstvandmærke:","Klik på piltasterne under Vandmærke i vinduet Pjece/vandmærk og vælg Nyt.","Klik på Tekst i vinduet Redigering af vandmærke.","Under Tekst skal du anvende vandmærkenavnet eller indtaste ny tekst.","Hvis du vil formatere vandmærket, skal du klikke på Fonte... og vælge en font.","For at angive vinklen på vandmærket på siden skal du indtaste eller vælge en procentsats eller bruge skyderen til at justere vinklen.","Hvis du vil angive placeringen af ​​vandmærket på siden, skal du vælge måleenhed og derefter indtaste værdien for vandret position og lodret position.","Tryk på Centrering for at placere vandmærket midt på siden.","Klik på OK.","Oprettelse af billedvandmærke","Et billedvandmærke anvender et billede som vandmærket. Billedfilen kan have formatet .bmp, .gif eller .jpg. Du kan oprette et billedvandmærke, der skal udskrives i et dokument og vælge indstillinger, som f.eks. format og placering på siden.","Sådan oprettes et billedvandmærke:","Klik på piltasterne under Vandmærke i vinduet Pjece/vandmærk og vælg Nyt.","Klik på Billede i vinduet Redigering af vandmærke.","Indtast stien og navnet på billedfilen eller klik på Vælg billede for at finde og vælge en billedfil. Der kan vælges .bmp, .jpg og .gif-filer.","Hvis du vil skalere billedet, skal du angive den procentsats, hvorved billedet skal forstørres eller reduceres.","Hvis du vil forskyde placeringen af ​​vandmærket fra midten af siden, skal du vælge måleenhed og derefter indtaste værdien for vandret position og lodret position.","Tryk på Centrering for at placere vandmærket midt på siden.","Klik på OK.","Redigering af vandmærke","Du kan ændre et vandmærke vha. Redigering af vandmærke.","Sådan redigeres et vandmærke:","Klik på piltasterne under Vandmærke i vinduet Pjece/vandmærk og vælg Rediger.","I vinduet Redigering af vandmærke skal du redigere de ønskede indstillinger.","Klik på OK.","Sletning af vandmærke","Vælg det vandmærke, der skal slettes, under Vandmærke i vinduet Pjece/vandmærk og klik på Slet.","Klik på Ja for at bekræfte sletningen.","Redigering af vandmærke","watermark_editor.html");
Page[56]=new Array("Vælg advancerede udskrivningsindstillinger i vinduet Avanceret. Valgene i dette vindue gælder for alle opgaver, som udskrives fra printerdriveren.","Hvis du vil se den installerede printerdriverversion, skal du rulle ned til bunden af vinduet.","Pjecerækkefølge","I vinduet Avanceret skal du vælge en indstilling ud for Pjecerækkefølge.","Venstre til højre fremstiller pjecen således, at når den foldes, findes foldningen i venstre side af pjecen. Venstre til højre angiver tekstens læseretning.","Højre til venstret giver pjecen et layout, så når den foldes, findes foldning til højre. Vælg denne indstilling, hvis du anvender et sprog, hvor der læses fra højre til venstre, f.eks. arabisk eller farsi.","Roter 180 grader","I vinduet Avanceret skal du klikke på piltasterne ud for Roter 180 grader og dernæst vælge den ønskede indstilling.","Printerstandard: Anvender de aktuelle printerindstillinger.","Ja eller Aktiveret: Lader automatisk printeren rotere billeder 180 grader. Printeren tager papirformat, retning, fremføringsretning og valgt efterbehandling i betragtning, når den roterer billeder.","Nej eller Inaktiveret: Inaktiverer funktionen.","Opgave-ID","I vinduet Avanceret skal du klikke på piltasterne ud for Opgaveidentifikation og dernæst vælge den ønskede indstilling.","Inaktiver opgave-ID: Forhindrer udskrivning af ID-oplysninger.","Udskriv ID på et bannerark: Udskriver opgave-ID på bannerarket.","Udskriv ID i margen - Kun på første side: Udskriver opgave-ID øverst i venstre margen på den første side i dokumentet.","Udskriv ID i margen - På alle sider: Udskriver opgave-ID øverst i venstre margen på alle sider i dokumentet.","Outputfunktioner","I vinduet Avanceret skal du klikke på piltasterne ud for Outputindstillinger og dernæst vælge den ønskede indstilling.","Printer Default: Prints using the default set by the system administrator at the printer control panel.","Face Up and Reverse Order: Delivers pages face up in descending order (3, 2, 1).","Tekstside nedad (anbefales) leverer siderne med tekstsiden nedad i nedadgående rækkefølge (3, 2, 1).","Face Up: Delivers pages face up in ascending order (1, 2, 3).","Face Down and Reverse Order: Delivers pages face down in ascending order (1, 2, 3).","Spejlbillede/Spejlvendt output","I vinduet Avanceret skal du vælge en indstilling ud for Spejlvendt output eller Spejlbillede.","Aktiveret eller Ja: Vender sidens billede om fra venstre til højre.","Inaktiveret eller Nej: Inaktiverer funktionen.","Negativt output","I vinduet Avanceret skal du klikke på piltasterne ud for Negativt billede og dernæst vælge den ønskede indstilling.","Aktiveret: Vender om på billedets lyse og mørke områder.","Inaktiveret: Inaktiverer Negativt billede.","Kladde","I vinduet Avanceret skal du klikke på piltasterne ud for Kladde og dernæst vælge den ønskede indstilling.","Ja eller Aktiveret: Udskriver kladder.","Nej eller Inaktiveret: Inaktiverer funktionen.","Jobforskydning/Forskydning","I vinduet Avanceret skal du klikke på piltasterne ud for Jobforskydning eller Forskydning og dernæst vælge den ønskede indstilling.","Forskyd hvert sæt: Forskyder hvert kopisæt en smule i en opgave bestående af mange kopisæt.","Ingen forskydning: Inaktiverer forskydning.","RGB neutrale grånuancer","I vinduet Avanceret skal du klikke på piltasterne ud for RGB neutrale grånuancer og dernæst vælge den ønskede indstilling.","Printerstandard: Anvender standardprinterindstillinger.","Automatisk sort anvender sort toner til sort og grå tekst og streggrafik. Denne indstilling bruger også sammensat sort til sorte og grå områder i fotos og grafik.","	Sammensat sort er en blanding af cyan, magenta og gul med sort toner.","Anvend kun sort anvender sort toner til alle sorte og grå områder på siden, inkl. tekst.","Anvend sammensat sort anvender sammensat sort til sort og grå dele af tekst, streggrafik, fotos og grafik.","Billedforbedring","I vinduet Avanceret skal du klikke på piltasterne ud for Billedforbedring og dernæst vælge den ønskede indstilling.","Automatisk anvender en kombination af indstillinger med bedste hastighed og kvalitetsgengivelse for hvert udskrivningsvalg.","Ja anvender alle tilgængelige forbedringer til at forbedre udskriftens kvalitet. Opgaver med denne indstilling tager længere tid om at udskrive.","Nej anvender ikke billedforbedringer.","Sort diffusering/Diffusering","I vinduet Avanceret skal du klikke på piltasterne ud for Diffusering og dernæst vælge den ønskede indstilling.","Ja eller Aktiveret: Får kanterne i farvede områder til at overlappe kanterne af sorte områder. Det påvirker ikke hvide områder.","Nej eller Inaktiveret: Inaktiverer funktionen.","Kun sort/hvid: Får farvede områder til at overlappe kanterne af sorte områder. Det påvirker ikke hvide områder.","Gråtoner/Brug printergråtoner","I vinduet Avanceret skal du klikke på piltasterne ud for Brug printergråtoner eller Gråtone og dernæst vælge den ønskede indstilling.","Lad software administrere gråtone lader dig justere gråtonens mønster i programmet. Anvend denne indstilling til at simulere en trykenhed med lav opløsning. Indstillingen anvender PostScript-driverens gråtoner, printerprogrammets gråtoner eller begge, når der indlæses gråtoner til printeren sammen opgaven.","Lad printer administrere gråtone anvender de gråtonemønstre, som er gemt på printeren.","Vælg en værdi i menuen.","TrueGray-grafik","Spring over blanke sider","I vinduet Avanceret skal du klikke på piltasterne ud for Spring over blanke sider og dernæst vælge den ønskede indstilling.","Ja: Ignorer blanke sider i en opgave.","Nej: Inkluderer blanke sider i en opgave.","Spot Color (farvekorrigering)","I vinduet Avanceret skal du klikke på piltasterne ud for Spot Color (farvekorrigering) og dernæst vælge den ønskede indstilling.","Lad software administrere Spot Colors anvender gråtoner fra PostScript-drivere, printerapplikationer eller begge for at omdanne Spot Colors til CMYK ved udskrivning. Anvend denne indstilling, hvis en special Spot Color ikke udskrives i den forventede nuance.","Cyan, magenta, gul og sort, som printeren anvender til at danne alle farver.","Lad printeren administrere Spot Colors lader printeren optimere omdannelsen af Spot colors til CMYK ved udskrivning.","Cyan, magenta, gul og sort, som printeren anvender til at danne alle farver.","Indbindingskant","I vinduet Avanceret skal du klikke på piltasterne ud for Indbindingskant og dernæst vælge den ønskede indstilling.","Automatisk (anbefales) indbinder opgaven langs enten den lange eller korte kant.","Indbinding langs lang kant indbinder opgaven langs papirets lange kant.","Indbinding langs kort kant indbinder opgaven langs papirets korte kant.","Glossniveau","I vinduet Avanceret skal du klikke på piltasterne ud for Glossyniveau og dernæst vælge den ønskede indstilling.","Normal udskriver en mat version af det originale glossy billede.","Udvidet duplikerer originalens glossy billede. Printeren udskriver langsommere, når denne indstilling er valgt.","Fremføringskant i magasin 5 (specialmagasin)","I vinduet Avanceret skal du klikke på piltasterne ud for 	Fremføringskant i magasin 5 (specialmagasin) og dernæst vælge den ønskede indstilling.","Automatisk valg lader printeren udskrive fra det magasin, som indeholder den ønskede papirtype og format for opgaven.","Lang fremføringskant (normal) fører papiret ind i printeren med den lange kant først.","Kort fremføringskant (normal) fører papiret ind i printeren med den korte kant først. Anvend denne indstilling til at udskrive etiketter, hæfte en anden del af siden eller udskrive på forhullet papir.","Optimering af udskrivning","Klik på Optimering af udskrivning, og vælg en indstilling.","Økonomioptimering: Udskriver langsommere, men anvender færre forbrugsstoffer.","Hastighedsoptimering: Udskriver hurtigere og anvender forbrugsstoffer som normalt.","Opløsning","I vinduet Avanceret skal du klikke på piltasterne ud for Opløsning og dernæst vælge den ønskede opløsningsindstilling.","Forbedring af tynde streger","I vinduet Avanceret skal du klikke på piltasterne ud for Forbedring af tynde streger og dernæst vælge den ønskede indstilling.","Ja: Gør tynde streger tykkere.","Nej: Inaktiverer Forbedring af tynde streger.","Papirkompensation","I vinduet Avanceret skal du klikke på piltasterne ud for Papirkompensation og dernæst vælge den ønskede indstilling.","Aktiveret: Gør udskrivningen langsommere for at sikre, at opgaven ikke krølles.","Inaktiveret (anbefales): Inaktiverer funktionen Papirkompensation.","Skilleark","Kontering","Tovejskommunikation","Udvidet","advanced.html");
Page[57]=new Array("Anvend disse indstillinger til at styre siderækkefølgen i pjecer. Anvend Pjecerækkefølge til at vælge pjecefoldning til venstre (Venstre til højre) eller højre (Højre til venstre).","Bemærk: Denne funktion er kun tilgængelig, når Pjecelayout er aktiveret.","Sådan vælges indstillinger for pjecerækkefølge:","I vinduet Avanceret skal du vælge en indstilling ud for Pjecerækkefølge.","Venstre til højre fremstiller pjecen således, at når den foldes, findes foldningen i venstre side af pjecen. Venstre til højre angiver tekstens læseretning.","Højre til venstret giver pjecen et layout, så når den foldes, findes foldning til højre. Vælg denne indstilling, hvis du anvender et sprog, hvor der læses fra højre til venstre, f.eks. arabisk eller farsi.","Pjecerækkefølge","booklet_image_order.html");
Page[58]=new Array("Roter 180 grader vender billedet på papiret, så den øverste kant bliver den nederste kant. Retningen kan indstilles som stående eller liggende.","Sådan vælges indstilling for Roter 180 grader:","I vinduet Avanceret skal du klikke på piltasterne ud for Roter 180 grader og dernæst vælge den ønskede indstilling.","Printerstandard: Anvender de aktuelle printerindstillinger.","Ja eller Aktiveret: Lader automatisk printeren rotere billeder 180 grader. Printeren tager papirformat, retning, fremføringsretning og valgt efterbehandling i betragtning, når den roterer billeder.","Nej eller Inaktiveret: Inaktiverer funktionen.","Roter 180 grader","rotate_image.html");
Page[59]=new Array("Opgave-ID udskriver dine opgaveoplysninger på et bannerark eller i opgavens margen. Indstillinger, som foretages her, anvendes, medmindre de tilsidesættes af Miljøsmart-indstillinger.","Et bannerark er et skilleark, som udskrives sammen med en udskrivningsopgave. Arket viser netværksbrugernavnet for opgaveafsenderen og dokumentnavnet. Når der er valgt bannerark, adskiller siden hvert færdigt sæt i udfaldsbakken. På visse printere tilsidesættes betjeningspanelindstillingen, hvad der er valgt i printerdriveren.","Bemærk: ","Inaktivering udskrivning af bannerark og udskrivning af ID-oplysninger i sidemargen er inkluderet i Miljøsmart-indstillingerne.","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges indstillinger for Opgaveidentifikation:","I vinduet Avanceret skal du klikke på piltasterne ud for Opgaveidentifikation og dernæst vælge den ønskede indstilling.","Inaktiver opgave-ID: Forhindrer udskrivning af ID-oplysninger.","Udskriv ID på et bannerark: Udskriver opgave-ID på bannerarket.","Udskriv ID i margen - Kun på første side: Udskriver opgave-ID øverst i venstre margen på den første side i dokumentet.","Udskriv ID i margen - På alle sider: Udskriver opgave-ID øverst i venstre margen på alle sider i dokumentet.","Opgave-ID","job_id.html");
Page[60]=new Array("Levering afgør, hvordan dine dokumenter leveres i printerens udfaldsbakke. Ved normal udskrivning leverer printeren opgaven med tekstsiden nedad. Visse papirformater og typer kan ikke behandles normalt og skal leveres med tekstsiden opad i udfaldsbakken. Derfor er visse funktioner for efterbehandling og 2-sidet udskrivning ikke tilgængelig for disse papirtyper.","Sådan vælges Outputindstillinger:","I vinduet Avanceret skal du klikke på piltasterne ud for Outputindstillinger og dernæst vælge den ønskede indstilling.","Tekstside nedad (anbefales) leverer siderne med tekstsiden nedad i nedadgående rækkefølge (3, 2, 1).","Face Up: Delivers pages face up in ascending order (1, 2, 3).","Face Down and Reverse Order: Delivers pages face down in ascending order (1, 2, 3).","Face Up and Reverse Order: Delivers pages face up in descending order (3, 2, 1).","Face Down and Reverse Order: Delivers pages face down in ascending order (1, 2, 3).","Outputfunktioner","output_options.html");
Page[61]=new Array("Spejlvendt output og Spejlbillede vender billedet og teksten på siden. Det svarer til at se en udskreven transparent fra bagsiden.","Sådan vælges indstillinger for Spejlvendt output og Spejlbillede:","I vinduet Avanceret skal du vælge en indstilling ud for Spejlvendt output eller Spejlbillede.","Aktiveret eller Ja: Vender sidens billede om fra venstre til højre.","Inaktiveret eller Nej: Inaktiverer funktionen.","Spejlvendt output","mirrored_output.html");
Page[62]=new Array("Negativt billede bytter om på mørke og lyse område i dit dokument og udskriver det som et fotonegativ. Udskrivning af et negativt billede kan være nyttigt for dokumenter, hvor det meste af baggrunden er mørk eller hvor tekst og billeder er meget lys. Sorte områder i originalen omdannes til hvide og hvide områder til sorte og alle mørkegrå områder bliver lysegrå osv.","Sådan vælges en indstilling for Negativt billede:","I vinduet Avanceret skal du klikke på piltasterne ud for Negativt billede og dernæst vælge den ønskede indstilling.","Aktiveret: Vender om på billedets lyse og mørke områder.","Inaktiveret: Inaktiverer Negativt billede.","Negativt output","negative_output.html");
Page[63]=new Array("Kladde sparer toner eller farver, men giver udskrifter af lavere kvalitet.","Bemærk: Kladde er også en del af Miljøsmart-indstillingerne.","Sådan vælges indstilling for Kladde:","I vinduet Avanceret skal du klikke på piltasterne ud for Kladde og dernæst vælge den ønskede indstilling.","Ja eller Aktiveret: Udskriver kladder.","Nej eller Inaktiveret: Inaktiverer funktionen.","Kladde","draft_mode.html");
Page[64]=new Array("Jobforskydning/Forskydning afgør, hvordan kopier forskydes i opgaver med mange kopier. Når funktionen er aktiveret, forskydes kopierne en smule i forhold til hinanden i udfaldsbakken. Du kan bruge denne funktion til at gøre sortering og håndtering af dokumenter lettere, når du udskriver flere kopier. Denne funktion er tilgængelig, hvis udfaldsbakken kan forskyde output.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges indstillinger for forskydning:","I vinduet Avanceret skal du klikke på piltasterne ud for Jobforskydning eller Forskydning og dernæst vælge den ønskede indstilling.","Forskyd hvert sæt: Forskyder hvert kopisæt en smule i en opgave bestående af mange kopisæt.","Ingen forskydning: Inaktiverer forskydning.","Jobforskydning/Forskydning","offset.html");
Page[65]=new Array("Hvis du vil definere, hvordan grå områder udskrives uden synlige farvenuancer, skal du vælge RGB neutrale grånuancer.","Sådan anvendes RGB neutrale grånuancer:","I vinduet Avanceret skal du klikke på piltasterne ud for RGB neutrale grånuancer og dernæst vælge den ønskede indstilling.","Printerstandard: Anvender standardprinterindstillinger.","Automatisk sort anvender sort toner til sort og grå tekst og streggrafik. Denne indstilling bruger også sammensat sort til sorte og grå områder i fotos og grafik.","	Sammensat sort er en blanding af cyan, magenta og gul med sort toner.","Anvend kun sort anvender sort toner til alle sorte og grå områder på siden, inkl. tekst.","Anvend sammensat sort anvender sammensat sort til sort og grå dele af tekst, streggrafik, fotos og grafik.","RGB neutrale grånuancer","rgb_neutral_gray.html");
Page[66]=new Array("Billedforbedring lader printeren afgøre, hvornår der skal anvendes Kantforbedring, Forbedring af tynde streger eller Diffusering for et billede.","Sådan vælges en indstilling for billedforbedring:","I vinduet Avanceret skal du klikke på piltasterne ud for Billedforbedring og dernæst vælge den ønskede indstilling.","Automatisk anvender en kombination af indstillinger med bedste hastighed og kvalitetsgengivelse for hvert udskrivningsvalg.","Ja anvender alle tilgængelige forbedringer til at forbedre udskriftens kvalitet. Opgaver med denne indstilling tager længere tid om at udskrive.","Nej anvender ikke billedforbedringer.","Billedforbedring","image_enhancement.html");
Page[67]=new Array("Får kanterne i farvede områder, undtagen hvide, til at overlappe hinanden og kanterne af sorte områder. Overlapning af disse områder hjælper med at kompensere for udskrivningsuregelmæssigheder, som kan forekomme pga. papirskift eller andre problemer.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan anvendes diffusering:","I vinduet Avanceret skal du klikke på piltasterne ud for Diffusering og dernæst vælge den ønskede indstilling.","Ja eller Aktiveret: Får kanterne i farvede områder til at overlappe kanterne af sorte områder. Det påvirker ikke hvide områder.","Nej eller Inaktiveret: Inaktiverer funktionen.","Kun sort/hvid: Får farvede områder til at overlappe kanterne af sorte områder. Det påvirker ikke hvide områder.","Diffusering","trapping.html");
Page[68]=new Array("Gråtonet er en udskrivningsmetode, hvor relativ mørkhed, tæthed og størrelsen af små prikker er forskellig for at gengive variationer i farve og lysstyrke. Mængden af detaljer i en gråtone afhænger af antallet af dpi (dots per inch). Desto større dpi, desto flere detaljer i udskriften. Gråtonet omtales nogle gange som rastereret.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges indstillinger for Gråtonet:","I vinduet Avanceret skal du klikke på piltasterne ud for Brug printergråtoner eller Gråtone og dernæst vælge den ønskede indstilling.","Lad software administrere gråtone lader dig justere gråtonens mønster i programmet. Anvend denne indstilling til at simulere en trykenhed med lav opløsning. Indstillingen anvender PostScript-driverens gråtoner, printerprogrammets gråtoner eller begge, når der indlæses gråtoner til printeren sammen opgaven.","Lad printer administrere gråtone anvender de gråtonemønstre, som er gemt på printeren.","Vælg en værdi i menuen.","Printergråtoner/Gråtoner","halftones.html");
Page[69]=new Array("I vinduet Avanceret skal du klikke på piltasterne ud for True Gray-grafik og dernæst vælge den ønskede indstilling.","Inaktiveret: Inaktiverer True Gray-grafik.","Aktiverer: Aktiverer True Gray-grafik.","TrueGray-grafik","true_gray_graphics.html");
Page[70]=new Array("Funktionen Spring over blanke sider konfigurerer printeren til at ignorere blanke sider i din opgave.","Sådan vælges Spring over blanke sider:","I vinduet Avanceret skal du klikke på piltasterne ud for Spring over blanke sider og dernæst vælge den ønskede indstilling.","Ja: Ignorer blanke sider i en opgave.","Nej: Inkluderer blanke sider i en opgave.","Spring over blanke sider","skip_blank_pages.html");
Page[71]=new Array("Spot Color blander cyan, magenta, gul og sort for at gengive Spot Colors fra en avis eller ugeblad.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges indstillinger for Spot Color (farvekorrigering):","I vinduet Avanceret skal du klikke på piltasterne ud for Spot Color (farvekorrigering) og dernæst vælge den ønskede indstilling.","Lad software administrere Spot Colors anvender gråtoner fra PostScript-drivere, printerapplikationer eller begge for at omdanne Spot Colors til CMYK ved udskrivning. Anvend denne indstilling, hvis en special Spot Color ikke udskrives i den forventede nuance.","Cyan, magenta, gul og sort, som printeren anvender til at danne alle farver.","Lad printeren administrere Spot Colors lader printeren optimere omdannelsen af Spot colors til CMYK ved udskrivning.","Cyan, magenta, gul og sort, som printeren anvender til at danne alle farver.","Spot Color (farvekorrigering)","spot_colors.html");
Page[72]=new Array("Indbindingskant huller eller hæfter opgaven langs papirets lange eller korte kant. Indbindingskant kan kun anvendes for papir, som tillader efterbehandling langs begge kanter.","Sådan vælges en indstilling for Indbindingskant:","I vinduet Avanceret skal du klikke på piltasterne ud for Indbindingskant og dernæst vælge den ønskede indstilling.","Automatisk (anbefales) indbinder opgaven langs enten den lange eller korte kant.","Indbinding langs lang kant indbinder opgaven langs papirets lange kant.","Indbinding langs kort kant indbinder opgaven langs papirets korte kant.","Indbindingskant","binding_edge.html");
Page[73]=new Array("Anvend Glossniveau til at udskrive et mat eller glossy billede.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges en indstilling for Glossniveau:","I vinduet Avanceret skal du klikke på piltasterne ud for Glossyniveau og dernæst vælge den ønskede indstilling.","Normal udskriver en mat version af det originale glossy billede.","Udvidet duplikerer originalens glossy billede. Printeren udskriver langsommere, når denne indstilling er valgt.","Glossniveau","gloss.html");
Page[74]=new Array("Fremføringskant eller Specialmagasinets fremføringskant afgør, hvordan papiret fremføres.","Sådan vælges fremføringskant i magasin 5 (specialmagasin):","I vinduet Avanceret skal du klikke på piltasterne ud for 	Fremføringskant i magasin 5 (specialmagasin) og dernæst vælge den ønskede indstilling.","Automatisk valg lader printeren udskrive fra det magasin, som indeholder den ønskede papirtype og format for opgaven.","Lang fremføringskant (normal) fører papiret ind i printeren med den lange kant først.","Kort fremføringskant (normal) fører papiret ind i printeren med den korte kant først. Anvend denne indstilling til at udskrive etiketter, hæfte en anden del af siden eller udskrive på forhullet papir.","Fremføringskant i magasin 5 (specialmagasin)","bypass_feed_edge.html");
Page[75]=new Array("Optimering af udskrivning gør det muligt at optimere udskrivningsopgaver fra en PCL-drriver for funktioner som f.eks. fonterstatning og scanning af lodrette og vandrette linialer.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Nogle indstillinger gælder kun for bestemte printermodeller eller -konfigurationer.","Sådan vælges indstillinger for Optimering af udskrivning:","Klik på Optimering af udskrivning, og vælg en indstilling.","Økonomioptimering: Udskriver langsommere, men anvender færre forbrugsstoffer.","Hastighedsoptimering: Udskriver hurtigere og anvender forbrugsstoffer som normalt.","Optimering af udskrivning","print_optimization.html");
Page[76]=new Array("Forbedring af tynde streger gør tynde streger tykkere, så selv de tyndeste streger udskrives.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan anvendes Forbedring af tynde streger:","I vinduet Avanceret skal du klikke på piltasterne ud for Forbedring af tynde streger og dernæst vælge den ønskede indstilling.","Ja: Gør tynde streger tykkere.","Nej: Inaktiverer Forbedring af tynde streger.","Forbedring af tynde streger","thin_line_enhancement.html");
Page[77]=new Array("Kombinationen af ​​visse papirformater, vægt, fiberretning og billeder kan få din opgave til at krølle. Papirkompensation forsinker udskrivningen og hjælper med at forhindre buning.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges indstillinger for papirkompensation:","I vinduet Avanceret skal du klikke på piltasterne ud for Papirkompensation og dernæst vælge den ønskede indstilling.","Aktiveret: Gør udskrivningen langsommere for at sikre, at opgaven ikke krølles.","Inaktiveret (anbefales): Inaktiverer funktionen Papirkompensation.","Papirkompensation","paper_compensation.html");
Page[78]=new Array("Skilleark giver dig mulighed for at tilføje et blankt ark mellem kopier, enkelte sider eller hele opgaven.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan udskrives der med skilleark:","Klik på Indstilling ud for Skilleark i vinduet Avanceret.","Vælg en indstilling for Skilleark.","Nej eller Ingen skilleark: Indsætter ikke skilleark.","Efter hvert sæt: Indsætter et skilleark efter hver kopi i udskrivningsopgaven. Denne indstilling kræver, at printeren har en harddisk.","Under Papir skal du vælge det papirmagasin, der indeholder skilleark. Skillearkene skal bruge et andet papirmagasin end det magasin, der anvendes til opgaven.","Klik på OK.","Indstilling for Skilleark","set_separators.html");
Page[79]=new Array("Kontering knyttes til dit brugernavn, og oplysninger til kontoidentifikation med hvert dokument du udskriver. Konteringsdata samles og gemmes, når opgaver sendes til printeren.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Ikke alle indstillinger vises afhængigt af dit konteringssystem eller konteringsmeddelelser.","Sådan indstilles kontering:","I vinduet Kontering skal du klikke på piltasterne ud for Konteringssystem og dernæst vælge den ønskede indstilling.","Xerox® Standardkontering Registrerer antallet af kopi-, udskrivnings-, scannings og faxopgaver for hver bruger. Det bruger de bruger-id'er og konto-id'er, der er forprogrammeret i printeren.","Xerox® Netværkskontering: Henter bruger-id'er og konto-id'er fra en netværksgodkendelsesserver.","Lokal kontering: Kræver en konteringskode for dit undernet. Dette kan være afdelingens konteringskode, f.eks. 0001. Andre koder er valgfrie.","Betal for udskrivning: Kræver en konterings-id for udskrivningsopgaver, som f.eks. en konterings-id for din afdeling. Andre id'er er valgfrie.","Send bruger-ID og konterings-ID: Kræver at du indtaster din bruger-id, konto-id og kodeord, hver gang du sender en udskrivningsopgave.","Send kun bruger-ID: Kræver at du indtaster din bruger-id og kodeord, hver gang du sender en udskrivningsopgave.","Send kun konto-ID: Kræver at du indtaster din konto-id og kodeord, hver gang du sender en udskrivningsopgave.","Send kun konterings-ID: Kræver at du indtaster din konterings-id og kodeord, hver gang du sender en udskrivningsopgave.","Send alle: Kræver at du indtaster din bruger-id, konto-id, konterings-id og kodeord, hver gang du sender en udskrivningsopgave.","Vælg en indstilling ud for Konteringsmeddelelse.","Always Prompt: Requires you to enter your user ID and account ID every time you submit a print job.","Do Not Prompt: Uses the information that you enter under Account Codes for every print job.","Vis kun meddelelse, hvis der er valgt Fax: Kræver, at du indtaster din bruger-id og konto-id, hver gang du sender en faxopgave.","Only Prompt for Color: Requires you to enter your user ID and account ID only for color print jobs.","Only Prompt for Color and Fax: Requires you to type your user ID and account ID only for color print jobs and faxes.","Vælg Skjul bruger-ID for at skjule bruger-ID'et i visningen. Stjerner * erstatter alle tegn, der angives i feltet.","Vælg Skjul konto-ID for at skjule konto-ID'et i visningen. Stjerner * erstatter alle tegn, der angives i feltet.","Indtast de nødvendige værdier under Standardkoder for kontering. Disse felter er obligatoriske, når du vælger Vis ikke meddelelse. Konto-id og konterings-id kan være afdelingens konteringskode, f.eks. 0001.","Klik på OK.","Kontering","accounting.html");
Page[80]=new Array("Hvis Kontering er aktiveret, og der er valgt konteringsmeddelelse for udskrivnings-, fax og farveudskrivningsopgaver, vises konteringsmeddelelsen, når du sender en af ​​disse opgaver.","Bemærk: Ikke alle indstillinger vises afhængigt af dit konteringssystem eller konteringsmeddelelser.","Hvis der er specificeret en standardværdi, kan du bruge den eller indtaste en ny værdi for Bruger-id.","Hvis der er specificeret en standardværdi, kan du bruge den eller indtaste en ny værdi for Kodeord.","Vælg om nødvendigt en kontotype.","Hvis der er specificeret en standardværdi, kan du bruge den eller indtaste en ny værdi for Konto-id.","Hvis der er specificeret en standardværdi, kan du bruge den eller indtaste en ny værdi for Konto-id kodeord.","Se også: ","Indstilling af Kontering","Konteringsmeddelelse","accounting_prompt.html");
Page[81]=new Array("Anvend Indstilling af tovejskommunikation til at aktivere tovejskommunikation mellem en netværksprinter og din computer.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan aktiveres eller inaktiveres tovejskommunikation:","Klik på Tovejskommunikation ud for Konfiguration i vinduet Avanceret.","Vælg Til eller Fra ud for Tovejskommunikation.","Klik på OK.","Tovejskommunikation","bi-di.html");
Page[82]=new Array("Miljøsmart-indstillinger er miljøvenlig-udskrivning, hvor papir- og energiforbruget reduceres. Du kan vælge Miljøsmart-indstillinger som standard for alle dine udskrivningsopgaver. Klik på knappen Miljøsmart-indstillinger for at få adgang til Miljøsmart-indstillinger.","Knappen Miljøsmart-indstillinger vises nederst på printerdriveren. Anvend denne knap til at vælge Miljøsmart-indstillinger for alle udskrivningsopgaver.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Ændring af Miljøsmart-indstillinger i en udskrivningsopgave, som sendes fra et softwareprogram, ændrer kun indstillingerne for den aktuelle opgave. Ændring af miljøsmart-indstillingerne i printerdriveren ændrer standardindstillingerne i alle programmer.","Sådan vælges Miljøsmart-indstillinger:","Vælg de ønskede indstillinger i vinduet Miljøsmart-indstillinger.","Vælg Indstil 2-sidet udskrivning for at udskrive alle opgaver på begge sider af papiret.","2-sidet, bogformat udskriver opgaven på begge sider af papiret, så der kan indbindes langs den lange kant. Nedenstående illustrationer viser resultatet for dokumenter med henholdsvis stående og liggende format.","@		@","Vælg Prøveudskrivning for at bruge mindre papir eller toner.","Prøvesæt udskriver et sæt af en opgave, som består af mange kopisæt, før de resterende kopier udskrives. Når du har kontrolleret prøvesættet, kan du enten vælge at udskrive de resterende kopier eller slette dem på printerens betjeningspanel.","Vælg Indstil Miljøsmart-prøveprint som min opgavetype for at udskrive én kopi af en opgave, som består af mange kopisæt og tilbageholde de resterende kopier i printeren.","Hvis du ikke vil udskrive bannerark sammen med hver opgave, skal du vælge Ingen bannerark or Inaktiver bannerark. Vælg en indstilling:","Et bannerark er et skilleark, som udskrives sammen med en udskrivningsopgave. Arket viser netværksbrugernavnet for opgaveafsenderen og dokumentnavnet. Når der er valgt bannerark, adskiller siden hvert færdigt sæt i udfaldsbakken. På visse printere tilsidesættes betjeningspanelindstillingen, hvad der er valgt i printerdriveren.","Udskriv ikke opgave-ID: Forhindrer udskrivning af ID-oplysninger.","Udskriv ID i margen - Kun på første side: Udskriver opgave-ID øverst i venstre margen på den første side i dokumentet.","Udskriv ID i margen - På alle sider: Udskriver opgave-ID øverst i venstre margen på alle sider i dokumentet.","Vælg Kladde eller Indstil kladde som min udskriftskvalitet for at spare toner ved at udskrive billeder med lavere kvalitet.","Klik på OK.","Miljøsmart-indstillinger","earth_smart.html");
